import React from 'react'
import image from '../images/cyanbb.png'
import Contact from '../components/Contact'
import contactsData from '../ContactData'
import { Link } from 'react-router-dom'



function ContactCard() {
    const contactDetails = contactsData.map(contacts => {
      return (
        <Contact
          id={contacts.id}
          {...contacts}
        />
      )
    })

    return (
      <div className='card-div'>
        {contactDetails}
      </div>
    );
  }

export default function Houses(){
    return (
        <div className='indexpage'>
            <img className='background-img' src={image} alt='background' />
            <div className='home-box'>
                <div className='house-postings'>
                  <h1>Post your house</h1>
                  <Link to ='#' className='btn btn-white btn-animation-1'>Postings</Link>
              </div>
                <h2>HOUSE LISTINGS</h2>
                <ContactCard />
            </div>
        </div>
    )
}
